import React from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    return (
        <div>
            <h3 className="h3">Twitter scams.....</h3>
            <br />
            <br />
            {
                Tweet.map(tweet => {
                    return (
                        <div className="box" key={tweet.id}><br/>
                            <strong>{tweet.url}</strong><br/>
                            {tweet.tweet_link}<br/>
                            {tweet.user_id}<br/>
                            {tweet.hastag}<br/>
                            {tweet.retweet_count}<br/>
                            {tweet.share_count}<br/>
                            {tweet.description}<br/>
                            {tweet.following}
                            {tweet.followers}

                        </div>

                    )
                })
            }
        </div>
    );
}

export default Twitter;
